import React from "react"
import './App.css';

function Home(props) {
  return (
    <div className="outer" >
      <div className="intro-left">
        <h4>Welcome!</h4>
        <h2>I'm Tanveer Brar, a second year Software Engineering student</h2>
        <h4>I am interested in gaining experience with web development. This is my website featuring my skills, personal projects and passions!</h4>
      </div>
      <div className="intro-right">
        <h1>Hello</h1>
      </div>
    </div>
  )
}

export default Home;
